import React from 'react';

const Nav = () => {
    return(
        <div>
            <h3>Menu</h3>
            <ul>
                <li>Who I Am</li>
                <li>Things I Do</li>
                <li>Talk To Me</li>
            </ul>
        </div>
    )
}

export default Nav;
